import { FC } from "react"
import { Item } from "../../types/Item"
import { CardPreview } from "../CardPreview"

type Props = {
   items: Item[],
}

export const Slides: FC<Props> = ({ items }) => {
  return (
    <ul className="carusel">
      {items.map((item: Item) => {
        return (
          <CardPreview item={item} />
        )
      })}
    </ul>
  )
}
